import React from "react";
import Tile from '../tile/Tile';

export const TileList = (tileData) => {
  return (
    <div>
      tileData.map((tileObj) => {
          
          <Tile name={tileObj.name} description={tileObj.description} />
      })
    </div>
  );
};
